import React, { Component } from 'react';

export class App extends Component {
  render(){
    return(
      <div className="body">
        <div className="nav-bar">
        <Tablist/>
        </div>
        <div className="main-body">
        <Body/>
        </div>
      </div>
    );
  }
}

export default App;
